    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        const inventory = this.props.inventory;
        let foundations = Object.keys(inventory).filter(
            name => inventory[name].foundation
        );
        let protein = Object.keys(inventory).filter(
            name1 => inventory[name1].protein
        );
        let extra = Object.keys(inventory).filter(
            name2 => inventory[name2].extra
        );
        let dressing = Object.keys(inventory).filter(
            name3 => inventory[name3].dressing
        );
        return (
            <div className="container">
                <React.Fragment>
                <h1>V채lj bas</h1>
                <ul>
                    {foundations.map(name => <li key={name}>{name}</li>)}
                </ul>
                <h2>V채lj protein</h2>
                <ul>
                    {protein.map(name1 => <li key={name1}>{name1}</li>)}
                </ul>
                <h3>V채lj extra</h3>
                <ul>
                    {extra.map(name2 => <li key={name2}>{name2}</li>)}
                </ul>
                <h4>V채lj dressing</h4>
                <ul>
                    {dressing.map(name3 => <li key={name3}>{name3}</li>)}
                </ul>
                </React.Fragment>
                <React.Fragment>
                <div class="dropdown">
                <button class="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                    Dropdown button
                </button>
                <div class="dropdown-menu" aria-labelledby="dropdownMenuButton">
                {foundations.map(name =><a class="dropdown-item" href="#">Action<li  key={name}>{name}</li> </a>)}
                </div>
                </div>
                </React.Fragment>

            </div>

        );
    }
}
export default ComposeSalad;
